import React, {Component} from 'react';
import './App.css';

class article extends Component {
    constructor() {
        super();
        this.state = {
            title: '',
            description: '',
            text: '',
            creationdate: '',
            editdate: '',
            uid: ''
        };
    }

    setter(props) {
        this.setState ({
            title: props.title,
            description: props.description,
            text: props.text,
            creationdate: props.creationdate,
            editdate: props.editdate,
            uid: props.uid
        })
    }

    render() {
        return(
        <div>
            <p>{this.state.title}</p>
            <p>{this.state.description}</p>
            <p>{this.state.text}</p>
            <p>{this.state.creationdate.toDate()}</p>
            <p>{this.state.editdate.toDate()}</p>
            <p>{this.state.uid}</p>
        </div>
        
        )
    }
}

export default article;
